import React from 'react'
import Wave from 'react-wavify'

class ShowDays extends React.Component{
    render(){
        return(
            <>
            {/* <div style={{width: '250px', height: '250px',borderRadius: '50%',background: '#e69915',position:'relative',zIndex:0}}> */}
                {/* <div style={{width: '230px', height: '230px',borderRadius: '50%',background: '#ffffff',position:'absolute',top:'10px',left:'10px',zIndex:-1}}></div> */}
                <div style={{width: '250px', height: '250px',position: 'relative'}} >            
                    <svg viewBox="0 0 125 125">
                        <mask id="myMask">
                            <rect x="0" y="0" width="125" height="125" fill="white"/>
                            <path d="M5,62.5 A20,20,0,0,1,120,62.5 A20,20,0,0,1,5,62.5 Z" fill="black" />
                        </mask>
                        <circle fill="#e69915" cx="62.5" cy="62.5" r="62.5" mask="url(#myMask)" />
                    </svg>
                    <Wave style= {{height: '100%',position: 'absolute',left: 0,opacity: 0.5}}fill="#ebef87" mask="url(#mask)" options={{ height:150,points: 4, speed: 1, amplitude: 12 }}>
                    {/* Example adapted from https://developer.mozilla.org/en-US/docs/Web/SVG/Element/mask */}
                        <mask id="mask">
                            <path d="M0,125 A20,20,0,0,1,250,125
                                    M0,125 A20,20,0,0,0,250,125 z" fill="white" />
                        </mask>
                    </Wave>
                    <Wave style= {{height: '100%',position: 'absolute',left: 0}}fill="#e69915" mask="url(#mask)" options={{ height:150,points: 4, speed: 1, amplitude: 7 }}>
                    {/* Example adapted from https://developer.mozilla.org/en-US/docs/Web/SVG/Element/mask */}
                        <mask id="mask">
                            <path d="M0,125 A20,20,0,0,1,250,125
                                    M0,125 A20,20,0,0,0,250,125 z" fill="white" />
                        </mask>
                    </Wave>
                </div>
                
            {/* </div> */}


            </>
        )
    }
}

export default ShowDays;
